De Afdeling II werd in de loop der tijd nog uitgebreid met de volgende bureaus, die elk een zeer speciale taak hadden, t.w.: 


Bureau Coördinatie: coördinerende werkzaamheden in verband met de opsporing van oorlogsmisdadigers van vreemde nationaliteit;


Bureau W: onderzoek naar en optreden tegen door ex-politieke delinquenten georganiseerde c.q. te organiseren acties;


Bureau Contact: onderhouden van contacten met het Rijksinstituut voor Oorlogsdocumentatie.

Uit een in het archief aangetroffen notitie kunnen we lezen wat de werkzaamheden van het BBR in 1950 waren: 


Executie van de maatregel van internering. Het ontslag van geïnterneerden volgens artikel 2, lid 3 van het Tribunaalbesluit;


De beoordeling of er aanleiding bestaat een opgelegde internering niet ten uitvoer te leggen ten aanzien van personen, die zich rechtmatig in vrijheid bevinden, omdat dit onnodig hard zou zijn, volgens artikel 2, lid 4 van het Tribunaalbesluit;


Hervatten van internering, indien de voorwaarden niet worden nagekomen, die gesteld zijn bij een vervroegd ontslag;


Het herstel in rechten, waaruit politieke delinquenten zijn ontzet, volgens de artikelen 3 en 4 van de Regeling ontzetting rechten (Stb. No. G. 218);


Het bevelen, dat door een tribunaal (kantonrechter) opgelegde verbeurdverklaring niet of niet geheel zal worden ten uitvoer gelegd, dan wel restitutie zal plaats hebben na de tenuitvoerlegging van zodanige verbeurdverklaring, volgens artikel 8, lid 3 van het Tribunaalbesluit;


Het registreren van de ontzettingen van rechten, opgelegd door een Tribunaal of kantonrechter, Bijzonder Gerechtshof, Raad van Cassatie en bij beslissing door een procureur-generaal tot voorwaardelijke buitenvervolgstelling;


Het verzamelen van statistische gegevens over de werkzaamheden van de Bijzondere raad van Cassatie de Bijzondere Gerechtshoven, de Bijzondere Strafkamers bij arrondissementsrechtbanken, Kantongerechten en Hoge Autoriteiten belast met het verlenen van het fiat-executie.

De voornaamste taak van het BBR bestond uit het verstrekken van inlichtingen over politieke delinquenten. De inlichtingen werden verstrekt aan: 


Het bureau Documentatie van de Hoofdafdeling Publiekrecht ten behoeve van de emigratie-autoriteiten;


Andere overheidsinstellingen, als de BVD, PTT, provinciale en gemeentelijke griffies en diverse departementen;


Particulieren.

Aan deze laatste categorie werden inlichtingen slechts bij hoge uitzondering verstrekt.

Hierin bevonden zich persoonskaarten van politieke delinquenten, die: 


Voorwaardelijk buiten vervolging waren gesteld; in dat geval stond op de kaart slechts vermeld de aard en datum van de veroordeling;


Veroordeeld waren door het tribunaal of door het bijzonder gerechtshof; behalve aard en datum van de veroordeling stonden ook de strafbare feiten op de kaart vermeld.
